const input = $input.first().json;
let rawText = input.output || '';

// 清洗掉換行符號、引號、星號等你不想要的符號
const cleanedText = rawText
  .replace(/[\n\r*"“”']/g, ' ')  // 去除換行與不必要符號
  .replace(/\s+/g, ' ')          // 合併多個空白為一個
  .trim();                       // 去除前後空白

return [
  {
    json: {
      cleaned_output: cleanedText
    }
  }
];

const timestamp = Date.now();
const randomSuffix = Math.floor(Math.random() * 10000); // 0~9999隨機數

const filename = `openaitest_${timestamp}_${randomSuffix}.jpg`;

// 回傳檔名
return [
  {
    json: {
      filename,
      // 其他你要傳的資料...
      imageBase64:$('Separate Image Outputs1').first().json.b64_json ,
    },
  },
];

const titleGatekeeperPrompt = `
請將以下「新聞內容」的情境，且根據限制，轉換成適合 gemini-2.5-flash-image 的英文繪圖 Prompt。

【新聞內容】：
$input.first().json.text

在生成英文 Prompt 時，請遵循以下結構與風格參數（所有 { } 變數須自動填入具體內容，不要保留 { }）：

A {**PHOTOREALISTIC/CINEMATIC**} {**SHOT TYPE**} of {**SUBJECT/PERSON/OBJECT**}, {**ACTION AND EXPRESSION**}, situated in {**ENVIRONMENT/SETTING**}. The scene is illuminated by {**LIGHTING DESCRIPTION**}, creating a {**MOOD/ATMOSPHERE**} atmosphere. Captured with a {**CAMERA/LENS DETAILS**}, emphasizing {**KEY TEXTURES AND DETAILS**}. The visual style is {**STYLE, e.g., a gritty documentary photograph/high-contrast editorial image**}. CONSTRAINTS: The image must NOT include **the White House**, {**ADD OTHER EXCLUSIONS HERE, e.g., any recognizable political figures or symbols**}. The final image must be clean and focus solely on the subject and immediate environment. The image should be in a {**ASPECT RATIO, e.g., 16:9/2:3**} format.

`;

return [
  {
    json: {
      prompt: titleGatekeeperPrompt,
    },
  },
];

// 取得 mergedContent
let mergedContent = $input.first().json.prompt || "";

// 轉成單行（移除換行符）
mergedContent = mergedContent.replace(/\r?\n/g, ' ');

// 回傳正確格式
return {
  body: JSON.stringify({
    contents: [
      {
        role: "user", // 建議加上 role
        parts: [
          {
            text: mergedContent
          }
        ]
      }
    ]
  })
};

